    "2016-05-25T00:33:01.928697",nt"name": "close-call-reporting-system",nt"isopen":
    true,nt"url": null,nt"notes": "The Confidential Close Call System (C3RS)
    is a research project intended to improve railroad safety by studying near miss
    incidents, determining root causes for unsafe conditions, and developing corrective
    actions and preventative measures. The project, sponsored by the Federal Railroad
    Administration and implemented by the Bureau of Transportation Statistics (BTS),
    operates under agreements with Union Pacific Railroad (UP), Canadian Pacific Railway
    (CP), and New Jersey Transit (NJT) to allow employees of participating railroads
    to voluntarily report close call events without threat of disciplinary action.",nt"license_title":
